# Fix lengths - correct padding
for i in range(len(stabilizers)):
    if len(stabilizers[i]) < 153:
        missing = 153 - len(stabilizers[i])
        print(f"Padding stabilizer {i} (length {len(stabilizers[i])}) with {missing} 'I's at the BEGINNING")
        stabilizers[i] = "I" * missing + stabilizers[i]

try:
    pauli_strings = [stim.PauliString(s) for s in stabilizers]
    # Use allow_redundant=True 
    tableau = stim.Tableau.from_stabilizers(pauli_strings, allow_redundant=True, allow_underconstrained=True)
    circuit = tableau.to_circuit(method='elimination')
    print("Circuit generated successfully.")
    
    # Verify locally
    print("Verifying locally...")
    sim = stim.TableauSimulator()
    sim.do_circuit(circuit)
    
    all_good = True
    for i, p in enumerate(pauli_strings):
        exp = sim.peek_observable_expectation(p)
        if exp != 1:
            print(f"Stabilizer {i} not preserved! Expectation: {exp}")
            all_good = False
            break
            
    if all_good:
        print("Local verification PASSED.")
        with open("circuit_generated.stim", "w") as f:
            f.write(str(circuit))
    else:
        print("Local verification FAILED.")

except Exception as e:
    print(f"Error: {e}")


